  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
    height:1
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
    height:1
  },
}));


export default function NeoplasmTable() {
  console.log("neo enter");
 // console.log(global.values.code);
